import axios from 'axios'

export const login = (information) =>{
    console.log(information)
    const email = information.login
    const password = information.password

    const body = {
        email: {email},
        password: {password}
    }
    axios.post('https://us-central1-labenu-apis.cloudfunctions.net/labeX/:aluno/login', body)
    .then
}
